import React from 'react';
import { Breadcrumbs, Link, Box, Typography, Grid, Paper, Avatar } from '@mui/material';
import { useLocation } from 'react-router-dom';

const ExcessInventoryItems = () => {
  const items = [
    { name: 'Tin', qty: 25548 },
    { name: 'Env', qty: 25548 },
    { name: 'Tin', qty: 25548 },
    { name: 'Tin', qty: 25548 },
    { name: 'Tin', qty: 25548 },
    { name: 'Tin', qty: 25548 }, 
    { name: 'Tin', qty: 25548 },
    { name: 'Tin', qty: 25548 },
    { name: 'Tin', qty: 25548 },
    { name: 'Tin', qty: 25548 },
    { name: 'Tin', qty: 25548 },
    { name: 'Tin', qty: 25548 },
    { name: 'Tin', qty: 25548 },
  ];

  const location = useLocation();
  const item = location.state?.item;

  return (
    <Box>
    <Typography variant="h4">
      Excess Inventory Items
    </Typography>
    {item && (
      <Box>
        <Typography variant="h6">Selected Item: {item.name}</Typography>
        <Typography>Quantity: {item.qty}</Typography>
      </Box>
    )}
  </Box>
  );
};

export default ExcessInventoryItems;
